import React from "readline"

const Character = ({characters = [] }) => {
    return(
        <div className="row">
            {characters.map((item, index) => {
                <div key={index} className="col">
                    <div className="card" style={{minWidth:"200px"}}>
                        <img src={item.image}  alt=""/>
                    </div>
                </div>
            })}
        </div>
    );

}

export default Character
